import './card.css';
import React, { useEffect, useState } from 'react';
import { nanoid } from 'nanoid'
import CardsList from './CardsList';
import AddCard from './AddCard';
import Trailer from './Trailer';
import NavBar from './NavBar';
import Card from './Card';
import { Navbar, Container, Nav, NavLink } from 'react-bootstrap'
import 'bootstrap/dist/css/bootstrap.min.css'
import { Routes, Route, Link } from "react-router-dom";
import FilteredList from './FiltredList';


export default function App() {
  return (
    <div className="App">
      <h1 className='app-title'>Movies List</h1>
      <Navbar bg="dark" data-bs-theme="dark">
        <Container>
          <Navbar.Brand href="#home" >Home</Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link > <Link to="/movies">Movies</Link></Nav.Link>
            <Nav.Link><Link to="/">Series</Link></Nav.Link>
            <Nav.Link><Link to="/anime">Anime</Link></Nav.Link>
          </Nav>
        </Container>
      </Navbar>
      <Routes>


        <Route path='movies/' element={<FilteredList />}></Route>
        <Route path='movies/trailer/:id/' element={<Trailer />} />
      </Routes>
    </div>
  )
}
